module.exports = function () {
  var $ = require('boxjs/dist/utils/_bdboxWrapper');
  /* eslint-disable */

  /**
   * 完成进度条
   * @memberOf Bdbox.client
   * @name progress
   * @author wangyongqing01
   * @version $Id: progress.js 286585 2016-03-15 11:57:15Z wangyongqing01 $
   */


  var andInvoke = require('../android/invokeApp');

  var iosInvoke = require('../ios/invokeApp');

  return function () {
    if ($.$isBox() && $.$isAndroid()) {
      andInvoke('bd_searchbox_interface', 'progressCompleted', []);
    } else if ($.$isBox() && $.$isIOS()) {
      iosInvoke('speedProgressCompleted', {
        'minver': '5.1.0.0'
      }, '');
    }
  };
}();